garden = [list(row) for row in data_raw.splitlines()]

def compute_adjacent_direction(pos, letter, garden):
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
    adjacent = []
    for direction in directions:
        new_pos = (pos[0] + direction[0], pos[1] + direction[1])
        if (0 <= new_pos[0] < len(garden) and
            0 <= new_pos[1] < len(garden[0]) and
            garden[new_pos[0]][new_pos[1]] == letter):
            adjacent.append(direction)
    return (adjacent, [d for d in directions if d not in adjacent])

def calculate_region(start_pos, garden):
    letter = garden[start_pos[0]][start_pos[1]]
    cells_to_check = [[start_pos, [], [(0, 0)]]]
    cells_checked = {}

    while cells_to_check:
        new_cells_to_check = []
        for cell in cells_to_check:
            adjacent, borders = compute_adjacent_direction(cell[0], letter, garden)
            novel_borders = [b for b in borders if b not in cell[1]]

            for direction in adjacent:
                if any(direction == (-origin[0], -origin[1]) for origin in cell[2]):
                    continue

                new_pos = (cell[0][0] + direction[0], cell[0][1] + direction[1])
                if new_pos in cells_checked:
                    for border in borders:
                        if border not in cells_checked[new_pos]:
                            continue
                        cells_checked[new_pos].remove(border)
                    continue

                for cell_ in new_cells_to_check:
                    if cell_[0] == new_pos:
                        cell_[1].extend(b for b in borders if b not in cell_[1])
                        cell_[2].append(direction)
                        break
                else:
                    new_cells_to_check.append([new_pos, borders.copy(), [direction]])

            cells_checked[cell[0]] = novel_borders
        cells_to_check = new_cells_to_check

    area, sides = 0, 0
    for cell, borders in cells_checked.items():
        area += 1
        sides += len(borders)
        garden[cell[0]][cell[1]] = "#"

    price = area * sides
    return price, garden

total_price = 0
for i, row in enumerate(reversed(garden)):
    for j, cell in enumerate(reversed(row)):
        if cell in ('#', ' '):
            continue
        row_index = len(garden) - 1 - i
        col_index = len(row) - 1 - j
        price, new_garden = calculate_region((row_index, col_index), garden)
        total_price += price
        garden = new_garden


print("Total price:", total_price)
